import React from 'react';

export default function Card({name, image, type, id}){
    return(
        <div key={id}>
            <h3>{name}</h3>
            <ul>
                {
                    type.map(tip=>
                        <li>{tip}</li>)
                }
            </ul>
            <img src={image} alt="Image not found" width="300px" height="300px"/>
        </div>

    );
}
